    false,nt"url": null,nt"notes": "The Midwinter Waterfowl Survey started
    in 1935, and is currently the oldest operational surveystill conducted annually.
    It is conducted nationwide at major concentrations of waterfowlwintering grounds
    to determine distribution and habitat affiliations. It had been the principalsource
    of information used to set hunting regulations until 1955, when breeding ground
    surveyswere initiated. It is also a source for population trends for some species,
    particularly those thatbreed in remote areas that arenu2019t easily accessible,
    such as the Arctic. The main benefit of thesesurveys is to provide input into management
    programs, chiefly harvest management plans.The Lewis and Clark National Wildlife
    Refuge is part of the largest estuary and wetland innorthwestern Oregon. The refuge
    is an tidally influenced wetland consisting of 33,000 acres ofislands, sandbars,
    mud flats and tidal marshes providing habitat for a variety of fish and wildlife.Over
    50,000 waterfowl of various species populate the refuge during the winter, making
    it animportant area to collect population information on the Pacific Flyway.",nt"owner_org":
